const Review=()=>{


    return (

        <div>
             <h1
             style={{
                textAlign: 'center',
             }}>Review</h1>
             <div
             style={{width: '80%',
                    height: '780px',
            }}
             className ="reviewForm">
            <form>
                <div style={{alignItems:'center',
            }}>
                <div class="mb-3">
                    <label for="review"  class="form-label">Tell us everything !</label>
                    <input style={{textAlign:'center'}} type="text" placeholder='Tell us everything !' class="form-control" id="review"/>
                </div>

                <button type="submit" class="btn btn-dark">Submit</button>
                </div>

            </form>
             </div>
        </div>

    )
}

export default Review;
